import React, { useState } from 'react';
import NavScrollExample from './nav';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

function Create()
{
    const[title,setTitle] = useState('');
    const[organizer,setOrganizer] = useState('');
    const[type,setType] = useState('');
    const[category,setCategory] = useState('');
    const[startdate,setStartdate] = useState('');
    const[enddate,setEnddate] = useState('');
    const[starttime,setStarttime] = useState('');
    const[endtime,setEndtime] = useState('');

    const handleSubmit = (event)=>
    {
        event.preventDefault();

        const data = {
            title:title,
            organizer: organizer,
            type:type,
            category: category,
            stardate: startdate,
            enddate: enddate,
            startdate: starttime,
            endtime: endtime
        };

        fetch('http://localhost:8080/create',
        {
            method: 'POST',
            headers:{
                'Content-Type':'application/json'
            },
            body:JSON.stringify(data)
        })

        .then(response => response.json())
        .then(data=>console.log(data))
        .catch(error=>comsole.error(error));
    }
    return(
        <div>
            <NavScrollExample></NavScrollExample>
                <div className='cplace'>
            <Form className='w-75'>
      <div className="mb-3" controlId="formBasicTitle">
        <label >Title</label>
        <input className="form-control" type="text" placeholder="Title" />
      </div>

      <Form.Group className="mb-3" controlId="formBasicOrganizer">
        <Form.Label>Organizer</Form.Label>
        <input className="form-control"  type="text" placeholder="Organizer" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicType">
        <Form.Label>Type</Form.Label>
        <input className="form-control"  type="text" placeholder="Type" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicCategory">
        <Form.Label>Category</Form.Label>
        <input className="form-control"  type="text" placeholder="Category" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicStartedate">
        <Form.Label>Startdate</Form.Label>
        <input className="form-control"  type="date" placeholder="Startdate" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicEndedate">
        <Form.Label>Enddate</Form.Label>
        <input className="form-control"  type="date" placeholder="Enddate" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicStartetime">
        <Form.Label>Start Time</Form.Label>
        <input className="form-control"  type="text" placeholder="Starttime" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicEndetime">
        <Form.Label>End Time</Form.Label>
        <input className="form-control"  type="text" placeholder="Endtime" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicStartetime"></Form.Group>
      <Form.Group className="mb-3" controlId="formBasicCheckbox">
        <Form.Check type="checkbox" label="Check me out" />
      </Form.Group>
      <Button variant="primary" type="submit">
        Submit
      </Button>
    </Form>
    </div>
    </div>
    );
}


export default Create;
